import { makeStyles, Paper } from '@material-ui/core'
import { Grid } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({

    paperrow: {
        width: '195px',
        height: '85px',
        // position: 'relative',
        boxShadow: 'none',
        borderRadius: '4px',
        border: '1px solid #AAAAAA',
        marginRight: '22.6px',
        marginBottom: '22.6px',
        // display: 'flex'



    },
    newdetext: {
        position: 'absolute',
        color: '#4A4A4A',
        fontSize: '13px',
        marginTop: "17px",
        fontWeight: '400'
    },
    infobutton: {
        position: 'absolute',
        width: '24px',
        height: '24px',
        marginTop: "14.5px",
        marginLeft: "1086px",
        color: "#485D84"
    },
    numinroom: {
        height: "25px",
        width: "84px",
        backgroundColor: '#D8D8D8',
        position: 'absolute',
        marginTop: '28px',
        marginLeft: '86px',
        borderRadius: '13px',
        fontSize: '13px',
        color: '#4A4A4A',
        fontWeight: '400',
        display: 'block'
    },
    personicon: {
        width: '18px',
        height: '18px',
        position: 'absolute',
        top: 4,
        left: 10
    },
    aligninicon: {
        display: 'inline-block',
        marginTop: '3px',
        marginLeft: '30px'
    },
    typeroom: {
        fontSize:'13px',
        color: '#969696',
        fontWeight: 400,
        position: 'absolute',
        top: '20px'

    }




}));

export default function Roomsection() {
    const classes = useStyles()

    return (
        <Paper className={classes.paperrow}>
            <div className={classes.typeroom}>
                Standard
            </div>
        </Paper>
    )
}
